const fz = require('zigbee-herdsman-converters/converters/fromZigbee');
const tz = require('zigbee-herdsman-converters/converters/toZigbee');
const exposes = require('zigbee-herdsman-converters/lib/exposes');
const constants = require('zigbee-herdsman-converters/lib/constants');
const reporting = require('zigbee-herdsman-converters/lib/reporting');
const e = exposes.presets;
const ea = exposes.access;
const {precisionRound} = require('zigbee-herdsman-converters/lib/utils');

const tzLocal = {
	co2_config: {
        key: ['auto_brightness', 'forced_recalibration', 'factory_reset_co2', 'long_chart_period',
            'manual_forced_recalibration', 'light_indicator', 'light_ind_level', 'automatic_scal', 'reading_delay', 'alarm'],
        convertSet: async (entity, key, rawValue, meta) => {
            const endpoint = meta.device.getEndpoint(2);
            const lookup = {'OFF': 0x00, 'ON': 0x01};
            const value = lookup.hasOwnProperty(rawValue) ? lookup[rawValue] : parseInt(rawValue, 10);
            const payloads = {
                auto_brightness: ['msCO2', {0x0203: {value, type: 0x10}}],
                forced_recalibration: ['msCO2', {0x0202: {value, type: 0x10}}],
                factory_reset_co2: ['msCO2', {0x0206: {value, type: 0x10}}],
                long_chart_period: ['msCO2', {0x0204: {value, type: 0x10}}],
                manual_forced_recalibration: ['msCO2', {0x0207: {value, type: 0x21}}],
                light_indicator: ['msCO2', {0x0211: {value, type: 0x10}}],
                light_ind_level: ['msCO2', {0x0209: {value, type: 0x20}}],
                automatic_scal: ['msCO2', {0x0402: {value, type: 0x10}}],
                reading_delay: ['msCO2', {0x0201: {value, type: 0x21}}],
                alarm: ['msCO2', {0x0240: {value, type: 0x10}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	pm25_config: {
        key: ['auto_clean_interval', 'manual_clean'],
        convertSet: async (entity, key, rawValue, meta) => {
            const endpoint = meta.device.getEndpoint(3);
            const lookup = {'OFF': 0x00, 'ON': 0x01};
            const value = lookup.hasOwnProperty(rawValue) ? lookup[rawValue] : parseInt(rawValue, 10);
            const payloads = {
		auto_clean_interval: ['pm25Measurement', {0x0330: {value, type: 0x20}}],
		manual_clean: ['pm25Measurement', {0x0331: {value, type: 0x10}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	temperaturef_config: {
        key: ['temperature_offset'],
        convertSet: async (entity, key, rawValue, meta) => {
            const endpoint = meta.device.getEndpoint(4);
            const value = parseFloat(rawValue)*10;
            const payloads = {
                temperature_offset: ['msTemperatureMeasurement', {0x0410: {value, type: 0x29}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
    humidity_config: {
        key: ['humidity_offset'],
        convertSet: async (entity, key, rawValue, meta) => {
            const endpoint = meta.device.getEndpoint(4);
            const value = parseInt(rawValue, 10);
            const payloads = {
                humidity_offset: ['msRelativeHumidity', {0x0210: {value, type: 0x29}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	co2_gasstat_config: {
        key: ['high_co2', 'low_co2', 'enable_co2'],
        convertSet: async (entity, key, rawValue, meta) => {
            const endpoint = meta.device.getEndpoint(2);
            const lookup = {'OFF': 0x00, 'ON': 0x01};
            const value = lookup.hasOwnProperty(rawValue) ? lookup[rawValue] : parseInt(rawValue, 10);
            const payloads = {
                high_co2: ['msCO2', {0x0221: {value, type: 0x21}}],
                low_co2: ['msCO2', {0x0222: {value, type: 0x21}}],
                enable_co2: ['msCO2', {0x0220: {value, type: 0x10}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	pm25_gasstat_config: {
        key: ['high_pm25', 'low_pm25', 'enable_pm25'],
        convertSet: async (entity, key, rawValue, meta) => {
            const endpoint = meta.device.getEndpoint(3);
            const lookup = {'OFF': 0x00, 'ON': 0x01};
            const value = lookup.hasOwnProperty(rawValue) ? lookup[rawValue] : parseInt(rawValue, 10);
            const payloads = {
                high_pm25: ['pm25Measurement', {0x0221: {value, type: 0x21}}],
                low_pm25: ['pm25Measurement', {0x0222: {value, type: 0x21}}],
                enable_pm25: ['pm25Measurement', {0x0220: {value, type: 0x10}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	voc_gasstat_config: {
        key: ['high_voc', 'low_voc', 'enable_voc'],
        convertSet: async (entity, key, rawValue, meta) => {
            const endpoint = meta.device.getEndpoint(4);
            const lookup = {'OFF': 0x00, 'ON': 0x01};
            const value = lookup.hasOwnProperty(rawValue) ? lookup[rawValue] : parseInt(rawValue, 10);
            const payloads = {
                high_voc: ['genAnalogInput', {0x0221: {value, type: 0x21}}],
                low_voc: ['genAnalogInput', {0x0222: {value, type: 0x21}}],
                enable_voc: ['genAnalogInput', {0x0220: {value, type: 0x10}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
};

const fzLocal = {
	co2: {
        cluster: 'msCO2',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            if (msg.data.hasOwnProperty('measuredValue')) {
                return {co2: Math.round(msg.data.measuredValue * 1000000)};
            }
        },
    },
	co2_config: {
        cluster: 'msCO2',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0202)) {
                result.forced_recalibration = ['OFF', 'ON'][msg.data[0x0202]];
            }
            if (msg.data.hasOwnProperty(0x0206)) {
                result.factory_reset_co2 = ['OFF', 'ON'][msg.data[0x0206]];
            }
            if (msg.data.hasOwnProperty(0x0205)) {
                result.set_altitude = msg.data[0x0205];
            }
            if (msg.data.hasOwnProperty(0x0207)) {
                result.manual_forced_recalibration = msg.data[0x0207];
            }
            if (msg.data.hasOwnProperty(0x0211)) {
                result.light_indicator = ['OFF', 'ON'][msg.data[0x0211]];
            }
            if (msg.data.hasOwnProperty(0x0209)) {
                result.light_ind_level = msg.data[0x0209];
            }
            if (msg.data.hasOwnProperty(0x0402)) {
                result.automatic_scal = ['OFF', 'ON'][msg.data[0x0402]];
            }
            if (msg.data.hasOwnProperty(0x0201)) {
                result.reading_delay = msg.data[0x0201];
            }
            if (msg.data.hasOwnProperty(0x0240)) {
                result.alarm = ['OFF', 'ON'][msg.data[0x0240]];
            }
            return result;
        },
    },
	pm25_config: {
        cluster: 'pm25Measurement',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0330)) {
                result.auto_clean_interval = msg.data[0x0330];
            }
            if (msg.data.hasOwnProperty(0x0331)) {
                result.manual_clean = ['OFF', 'ON'][msg.data[0x0331]];
            }
            return result;
        },
    },
	pm25: {
        cluster: 'pm25Measurement',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty('measuredValue')) {
                result.pm25 = precisionRound(msg.data.measuredValue*10, 1);
            }
            if (msg.data.hasOwnProperty(0x0601)) {
                result.pm1 = precisionRound(msg.data[0x0601]*10, 1);
            }
            if (msg.data.hasOwnProperty(0x0603)) {
                result.pm_size = precisionRound(msg.data[0x0603], 1);
            }
            if (msg.data.hasOwnProperty(0x0602)) {
                result.pm10 = precisionRound(msg.data[0x0602]*10, 1);
            }
            if (msg.data.hasOwnProperty(0x0604)) {
                result.aqi_25_index = msg.data[0x0604];
            }
            return result;
        },
    },
	air_quality: {
        cluster: 'genAnalogInput',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty('presentValue')) {
                result.voc_index = msg.data.presentValue;
            }
            return result;
        },
    },
	temperaturef_config: {
        cluster: 'msTemperatureMeasurement',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0410)) {
                result.temperature_offset = parseFloat(msg.data[0x0410])/10.0;
            }
            return result;
        },
    },
    humidity_config: {
        cluster: 'msRelativeHumidity',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0210)) {
                result.humidity_offset = msg.data[0x0210];
            }
            return result;
        },
    },
	co2_gasstat_config: {
        cluster: 'msCO2',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0221)) {
                result.high_co2 = msg.data[0x0221];
            }
            if (msg.data.hasOwnProperty(0x0222)) {
                result.low_co2 = msg.data[0x0222];
            }
            if (msg.data.hasOwnProperty(0x0220)) {
                result.enable_co2 = ['OFF', 'ON'][msg.data[0x0220]];
            }
            return result;
        },
    },
	pm25_gasstat_config: {
        cluster: 'pm25Measurement',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0221)) {
                result.high_pm25 = msg.data[0x0221];
            }
            if (msg.data.hasOwnProperty(0x0222)) {
                result.low_pm25 = msg.data[0x0222];
            }
            if (msg.data.hasOwnProperty(0x0220)) {
                result.enable_pm25 = ['OFF', 'ON'][msg.data[0x0220]];
            }
            return result;
        },
    },
	voc_gasstat_config: {
        cluster: 'genAnalogInput',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0221)) {
                result.high_voc = msg.data[0x0221];
            }
            if (msg.data.hasOwnProperty(0x0222)) {
                result.low_voc = msg.data[0x0222];
            }
            if (msg.data.hasOwnProperty(0x0220)) {
                result.enable_voc = ['OFF', 'ON'][msg.data[0x0220]];
            }
            return result;
        },
    },
};

const definition = {
        zigbeeModel: ['EFEKTA_Smart_AQ_Box'],
        model: 'EFEKTA_Smart_AQ_Box',
        vendor: 'EfektaLab',
        description: '[EFEKTA Smart Air Quality Box, PM1.0, PM2.5, PM10, AQ PM2.5 Index, PM Size, CO2, VOC Index, Pressure, Temperature, Humidity, ws2812b indicator, can control the relay, binding on some other devices](http://efektalab.com/Smart_Air_Quality_Box)',
        fromZigbee: [fz.temperature, fz.humidity, fz.pressure, fzLocal.co2, fzLocal.co2_config, fzLocal.pm25_config, fzLocal.pm25, fzLocal.air_quality, fzLocal.temperaturef_config, fzLocal.humidity_config, fzLocal.co2_gasstat_config, fzLocal.pm25_gasstat_config, fzLocal.voc_gasstat_config],
        toZigbee: [tz.factory_reset, tzLocal.co2_config, tzLocal.pm25_config, tzLocal.temperaturef_config, tzLocal.humidity_config, tzLocal.co2_gasstat_config, tzLocal.pm25_gasstat_config, tzLocal.voc_gasstat_config],
        configure: async (device, coordinatorEndpoint, logger) => {
            const endpoint2 = device.getEndpoint(2);
            const endpoint3 = device.getEndpoint(3);
            const endpoint4 = device.getEndpoint(4);
            const clusters2 = ['msCO2'];
            const clusters3 = ['pm25Measurement'];
            const clusters4 = ['genAnalogInput', 'msPressureMeasurement', 'msTemperatureMeasurement', 'msRelativeHumidity'];
            await reporting.bind(endpoint2, coordinatorEndpoint, clusters2);
            await reporting.bind(endpoint3, coordinatorEndpoint, clusters3);
            await reporting.bind(endpoint4, coordinatorEndpoint, clusters4);
            const payload1 = [{attribute: {ID: 0x0000, type: 0x39},
            minimumReportInterval: 30, maximumReportInterval: 600, reportableChange: 0.000001}];
            await endpoint2.configureReporting('msCO2', payload1);
			
            const payload2 = [{attribute: {ID: 0x0000, type: 0x39},
            minimumReportInterval: 30, maximumReportInterval: 600, reportableChange: 0.1}];
            await endpoint3.configureReporting('pm25Measurement', payload2);
			
            const payload3 = [{attribute: {ID: 0x0601, type: 0x39},
            minimumReportInterval: 30, maximumReportInterval: 600, reportableChange: 0.1}];
            await endpoint3.configureReporting('pm25Measurement', payload3);
			
            const payload4 = [{attribute: {ID: 0x0602, type: 0x39},
            minimumReportInterval: 30, maximumReportInterval: 600, reportableChange: 0.1}];
            await endpoint3.configureReporting('pm25Measurement', payload4);
			
            const payload5 = [{attribute: {ID: 0x0603, type: 0x39},
            minimumReportInterval: 30, maximumReportInterval: 600, reportableChange: 0.1}];
            await endpoint3.configureReporting('pm25Measurement', payload5);
			
            const payload6 = [{attribute: {ID: 0x0604, type: 0x39},
            minimumReportInterval: 30, maximumReportInterval: 600, reportableChange: 1}];
            await endpoint3.configureReporting('pm25Measurement', payload6);
			
            const payload7 = [{attribute: {ID: 0x0055, type: 0x39},
            minimumReportInterval: 30, maximumReportInterval: 300, reportableChange: 1}];
            await endpoint4.configureReporting('genAnalogInput', payload7);
			
            const payload8 = [{attribute: {ID: 0x0000, type: 0x29},
            minimumReportInterval: 30, maximumReportInterval: 600, reportableChange: 10}];
            await endpoint4.configureReporting('msTemperatureMeasurement', payload8);
			
            const payload9 = [{attribute: {ID: 0x0000, type: 0x21},
            minimumReportInterval: 30, maximumReportInterval: 600, reportableChange: 30}];
            await endpoint4.configureReporting('msRelativeHumidity', payload9);
			
            const payload10 = [{attribute: {ID: 0x0000, type: 0x29},
            minimumReportInterval: 30, maximumReportInterval: 300, reportableChange: 1}];
            await endpoint4.configureReporting('msPressureMeasurement', payload10);
        },
        icon: 'data:image/png;base64,',
        exposes: [e.co2(), e.pm25(), e.pm1(), e.pm10(),
            exposes.numeric('pm_size', ea.STATE).withLabel('PM Size').withUnit('µm').withDescription('Typical Particle Size'),
            exposes.numeric('aqi_25_index', ea.STATE).withLabel('PM25 Index').withUnit('PM2.5 Index').withDescription('PM 2.5 INDEX'),
            exposes.numeric('voc_index', ea.STATE).withLabel('VOC Index').withUnit('VOC Index').withDescription('VOC INDEX'),
            e.pressure(), e.temperature(), e.humidity(),
            exposes.numeric('reading_delay', ea.STATE_SET).withUnit('Seconds').withDescription('Setting the sensor reading delay. Setting the time in seconds, by default 30 seconds')
                .withValueMin(10).withValueMax(600),
            exposes.binary('alarm', ea.STATE_SET, 'ON', 'OFF').withDescription('Alarm'),
            exposes.binary('light_indicator', ea.STATE_SET, 'ON', 'OFF').withDescription('Enable or Disable light_indicator'),
            exposes.numeric('light_ind_level', ea.STATE_SET).withUnit('%').withDescription('light_indicator_level')
                .withValueMin(0).withValueMax(100),
            exposes.numeric('temperature_offset', ea.STATE_SET).withUnit('°C').withValueStep(0.1).withDescription('Adjust temperature')
                .withValueMin(-50.0).withValueMax(50.0),
            exposes.numeric('humidity_offset', ea.STATE_SET).withUnit('%').withDescription('Adjust humidity')
                .withValueMin(-50).withValueMax(50),
            exposes.numeric('auto_clean_interval', ea.STATE_SET).withUnit('day').withDescription('Auto clean interval PM2.5 sensor')
                .withValueMin(0).withValueMax(10),
            exposes.binary('manual_clean', ea.STATE_SET, 'ON', 'OFF').withDescription('Manual clean PM2.5 sensor'),
            exposes.binary('forced_recalibration', ea.STATE_SET, 'ON', 'OFF').withDescription('Start FRC (Perform Forced Recalibration of the CO2 Sensor in the fresh air)'),
            exposes.numeric('manual_forced_recalibration', ea.STATE_SET).withUnit('ppm').withDescription('Start FRC (Perform Forced Recalibration of the CO2 Sensor according to data from another sensor)')
                .withValueMin(0).withValueMax(5000),
            exposes.binary('automatic_scal', ea.STATE_SET, 'ON', 'OFF')
                .withDescription('Automatic self calibration'),
            exposes.binary('factory_reset_co2', ea.STATE_SET, 'ON', 'OFF').withDescription('Factory Reset CO2 sensor'),
            exposes.binary('enable_co2', ea.STATE_SET, 'ON', 'OFF').withDescription('Enable CO2 Gas Control'),
            exposes.numeric('high_co2', ea.STATE_SET).withUnit('ppm').withDescription('Setting High CO2 Gas Border')
                .withValueMin(400).withValueMax(2000),
            exposes.numeric('low_co2', ea.STATE_SET).withUnit('ppm').withDescription('Setting Low CO2 Gas Border')
                .withValueMin(400).withValueMax(2000),
            exposes.binary('enable_pm25', ea.STATE_SET, 'ON', 'OFF').withDescription('Enable PM2.5 Control'),
            exposes.numeric('high_pm25', ea.STATE_SET).withUnit('µg/m³').withDescription('Setting High PM2.5 Border')
                .withValueMin(0).withValueMax(1000),
            exposes.numeric('low_pm25', ea.STATE_SET).withUnit('µg/m³').withDescription('Setting Low PM2.5 Border')
                .withValueMin(0).withValueMax(1000),
            exposes.binary('enable_voc', ea.STATE_SET, 'ON', 'OFF').withDescription('Enable VOC Control'),
            exposes.numeric('high_voc', ea.STATE_SET).withUnit('index point').withDescription('Setting High VOC Border')
                .withValueMin(0).withValueMax(500),
            exposes.numeric('low_voc', ea.STATE_SET).withUnit('index point').withDescription('Setting Low VOC Border')
                .withValueMin(0).withValueMax(500)],
};

module.exports = definition;